import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import { Link } from "react-router-dom";

export default function NavigationBar() {
  return (
    <AppBar position="static" color="default" elevation={1}>
      <Toolbar
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          paddingX: 2,
        }}
      >
        {/* Navigation Links - Spread Across the Bar */}
        <Box sx={{ display: "flex", flexGrow: 1, gap: 4 }}>
          <Button component={Link} to="/venues" color="inherit" sx={{ textTransform: "none" }}>
            Venues
          </Button>
          <Button component={Link} to="/hair" color="inherit" sx={{ textTransform: "none" }}>
            Hair
          </Button>
          <Button component={Link} to="/makeup" color="inherit" sx={{ textTransform: "none" }}>
            Makeup
          </Button>
          <Button component={Link} to="/photographers" color="inherit" sx={{ textTransform: "none" }}>
            Photographers
          </Button>
          <Button component={Link} to="/music" color="inherit" sx={{ textTransform: "none" }}>
            Music
          </Button>
        </Box>

        {/* Logo Placeholder - Smaller Font */}
        <Box
          component={Link}
          to="/new"
          sx={{
            display: "flex",
            alignItems: "center",
            textDecoration: "none",
            color: "inherit",
            marginLeft: "auto", // Push the logo to the far right
          }}
        >
          <Box
            sx={{
              width: 40,
              height: 40,
              backgroundColor: "#ccc",
              borderRadius: "50%",
              marginRight: 1,
            }}
          />
          <Typography variant="h6" sx={{ fontSize: "1rem", fontWeight: "bold" }}>
            Logo Placeholder
          </Typography>
        </Box>

        {/* Shopping Cart Icon */}
        <IconButton
          component={Link}
          to="/cart"
          color="inherit"
          sx={{
            marginLeft: 2, // Add spacing between logo and cart
          }}
        >
          <ShoppingCartIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
